import React from "react";
import styled from "styled-components";
import { IoMdArrowRoundForward } from "react-icons/io";

const SloganHeaderBlock = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 1.3rem;
  padding-top: 10px;
  padding-left: 30px;
  padding-right: 10px;
  background-color: white;
  color: black;
  p {
    font-size: 2rem;
    font-weight: bold;
    color: white;
    padding-right: 7rem;
  }
  ul {
    display: flex;
    list-style: none;
    padding-left: 0;
  }
  ul li {
    padding: 6px 12px;
  }
  span + span {
    margin-left: 1rem;
  }

  .GoCommunity {
    justify-content: center;
    :hover {
      color: gray;
    }
  }
`;

function Slogan_Header() {
  return (
    <SloganHeaderBlock>
      <p>EndLess Creation</p>
      <ul>
        <li>AboutEC</li>
        <li>Activity</li>
        <li>Project</li>
        <li>Member</li>
        <li>Contact</li>
      </ul>
      <div>
        Community
        <IoMdArrowRoundForward size="15" />
      </div>
    </SloganHeaderBlock>
  );
}

export default Slogan_Header;
